import React, { useState } from "react";

import { Menu, MenuItem } from "react-pro-sidebar";

import { Button, Img, Line, Text } from "components";
import Sidebar1 from "components/Sidebar1";
import StudentProfile from "components/StudentProfile";
import SidebarOverlay from "components/SidebarOverlay";
import Footer from "components/Footer";
import { Link, useNavigate } from "react-router-dom";

const FrameOnePage = () => {
  function handleNavigate() {
    const win = window.open("https://umat.edu.gh", "_blank");
    win.focus();
  }
  const navigate = useNavigate();
  const handleMySubmissionsClick = () => {
    // Navigate to the new page when the button is clicked
    navigate("/MySubmissions");
  };
  const [isOpen, setIsOpen] = useState(false);

  const openNav = () => {
    setIsOpen(true);
  };
  return (
    <>
      <div className="flex md:flex-col-3 page-content bg-white-A700 font-inika mx-auto relative w-full">
        <div className="md:relative md:col-span-1 ">
          <Sidebar1
            openNav={openNav}
            className="h-full bg-teal-900 flex justify-start left-[0] top-[0]"
          />
        </div>

        <div className="relative md:col-span-2 items-center justify-start md:ml-[0] w-full">
          <div className="mb-[5%]">
            <StudentProfile />
          </div>
          <table class="md:table-fixed border border-collapse border-slate-400 mt-[10%]">
            <thead>
              <tr>
                <th>Topic</th>
                <th>Research</th>
                <th>Year</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td className="border border-slate-300">The Sliding Mr. Bones (Next Stop, Pottersville)</td>
                <td className="border border-slate-300">Malcolm Lockyer</td>
                <td className="border border-slate-300">1961</td>
              </tr>
              <tr>
                <td className="border border-slate-300">Witchy Woman</td>
                <td className="border border-slate-300">The Eagles</td>
                <td className="border border-slate-300">1972</td>
              </tr>
              <tr>
                <td className="border border-slate-300">The Sliding Mr. Bones (Next Stop, Pottersville)</td>
                <td className="border border-slate-300">Malcolm Lockyer</td>
                <td className="border border-slate-300">1961</td>
              </tr>
              <tr>
                <td className="border border-slate-300">Shining Star</td>
                <td className="border border-slate-300">Earth, Wind, and Fire</td>
                <td className="border border-slate-300">1975</td>
              </tr>
              <tr>
                <td className="border border-slate-300">The Sliding Mr. Bones (Next Stop, Pottersville)</td>
                <td className="border border-slate-300">Malcolm Lockyer</td>
                <td className="border border-slate-300">1961</td>
              </tr>
              <tr>
                <td className="border border-slate-300">The Sliding Mr. Bones (Next Stop, Pottersville)</td>
                <td className="border border-slate-300">Malcolm Lockyer</td>
                <td className="border border-slate-300">1961</td>
              </tr>
            </tbody>
          </table>
          <Footer />
        </div>
      </div>
    </>
  );
};

export default FrameOnePage;

